import React from "react";

import Navbar from "../common/navbar/navbar";
import Footer from "../common/footer/footer";
import Profile from "./profile.js";
import Cover from "../common/cover/cover.js";
import Accordion from "../common/accordion/accordion.js";

import "./user-dashboard.css";

import {
  Container,
  Form,
  FormGroup,
  InputGroup,
  Label,
  Input,
  Button,
  Row,
  Col,
  Badge,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownItem,
  DropdownMenu
} from "reactstrap";
import DefaultOrderValue from './default-order-value.js';
import LabelManagement from './label-management.js';
import ShargeHistory from './sharge-history.js';

class UserDashboardPage extends React.Component {
  render() {
    return (
      <div>
        <Navbar isLogin="true" />

        <div className="">
          <main className="profile-page pb-5" ref="main">
            <Cover />

            <Profile />

            <Row>
              <Col lg="6">
                <DefaultOrderValue />
              </Col>
              <Col lg="6">
                <LabelManagement />
              </Col>
              <Col lg="12">
                <ShargeHistory />
              </Col>
            </Row>

          </main>
        </div>

        <Footer />
      </div>
    );
  }
}

export default UserDashboardPage;
